Vluchtelingen krijgen niet standaard een hotel. Dat kan soms gebeuren vanwege een tekort aan opvangplekken. En terecht, want anders slapen ze op straat.

Hetzelfde gebeurde ook met daklozen tijdens de lockdown: https://t.co/uF9eh9B7zq

Ook @ProvincieNH doet afstand van uitspraken van @FritsHuffnagel over #vluchtelingen. 

Provincie doet nog mee met Canal Parade, maar met missie om zoveel mogelijk verhalen en mensen van verschillende achtergronden een podium te geven. 

